import Login_Signup from "./pages/login-signup";
import Mail from "./pages/mail";
import LoginForm from "./pages/LoginForm";
import SignUpForm from "./pages/SignupForm";
import { BrowserRouter, Routes, Route } from 'react-router-dom' 
import React, { useEffect } from 'react';


const requireAuth = (nextState, navigate) => {
  // Pemeriksaan autentikasi di sini, contoh menggunakan variabel isUserLoggedIn
  const isUserLoggedIn = true; // Gantilah dengan logika autentikasi sebenarnya

  if (!isUserLoggedIn) {
    // Jika pengguna belum login, arahkan ke halaman login
    navigate('/login');
  }
};

export default function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Login_Signup />} />
          <Route path="/mail" element={<Mail />} canActivate={requireAuth} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}
